import { v4 as uuidv4 } from 'uuid';
import ProjectImg from '../images/projectImg.png';
import UTrackerImg from '../images/myuka.jpg';
import GreenCtgImg from '../images/portfolio.jpg';
import CoinTrackerImg from '../images/cointracker.jpg';
import CavinImg from '../images/cavinimg.jpg';

const projects = [
  {
    id: uuidv4(),
    name: 'Myuka',
    desc:
      'Cette application renseigne des informations sur les produits alimentaires grâce à une API.',
    img: UTrackerImg,
  },
  {
    id: uuidv4(),
    name: 'Ce portfolio',
    desc:
      'Ce portfolio a été réalisé avec REACT',
    img: GreenCtgImg,
  },
  {
    id: uuidv4(),
    name: 'Exercices JS',
    desc:
      'Ces exercices ont eu pour but de me familiariser avec le langage JavaScript',
    img: CoinTrackerImg,
  },
  {
    id: uuidv4(),
    name: "Cavin's Portfolio",
    desc:
      'A portfolio for Cavin jr. A artist from New york city. The portfolio is made using ReactJs and GatsbyJs.',
    img: CavinImg,
  },
  {
    id: uuidv4(),
    name: 'Tracking Soft',
    desc:
      'A tracking website that will show the performance of the website. Also you will get some useful advice to improve the performance.',
    img: ProjectImg,
  },
];

export default projects;
